const html = "<h1 id=\"installation\" tabindex=\"-1\">Installation <a class=\"header-anchor\" href=\"#installation\" aria-hidden=\"true\">#</a></h1>\n<h3 id=\"install-to-existing-project\" tabindex=\"-1\">Install to existing project <a class=\"header-anchor\" href=\"#install-to-existing-project\" aria-hidden=\"true\">#</a></h3>\n<ol>\n<li>Add npm package to your project:</li>\n</ol>\n<pre><code class=\"language-bash\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">bash</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #C9D1D9\">yarn add @vuico/vuic</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n<p>or</p>\n<pre><code class=\"language-bash\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">bash</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #C9D1D9\">npm i @vuico/vuic</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n<ol start=\"2\">\n<li>Use Vuic plugin:</li>\n</ol>\n<pre><code class=\"language-typescript\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">typescript</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #8B949E\">// src/main.ts</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { VuicPlugin } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">&quot;@vuico/vuic&quot;</span><span style=\"color: #C9D1D9\">;</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">app.</span><span style=\"color: #D2A8FF\">use</span><span style=\"color: #C9D1D9\">(VuicPlugin);</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">app.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">&quot;#app&quot;</span><span style=\"color: #C9D1D9\">);</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n<hr>\n<h3 id=\"generate-new-project\" tabindex=\"-1\">Generate new project <a class=\"header-anchor\" href=\"#generate-new-project\" aria-hidden=\"true\">#</a></h3>\n<p>The easiest way to get started with Vuic is using yarn and Vite CLI.</p>\n<ol>\n<li>Run CLI:</li>\n</ol>\n<pre><code class=\"language-bash\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">bash</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #C9D1D9\">yarn create vite</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n<ol start=\"2\">\n<li>Choose these options:</li>\n</ol>\n<ul>\n<li>Vue</li>\n<li>TypeScript</li>\n</ul>\n<ol start=\"3\">\n<li>Add npm package:</li>\n</ol>\n<pre><code class=\"language-bash\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">bash</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #C9D1D9\">yarn add @vuico/vuic</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n<ol start=\"4\">\n<li>Use Vuic plugin:</li>\n</ol>\n<pre><code class=\"language-typescript\"><div class=\"htw-relative htw-not-prose __histoire-code\"><div class=\"htw-absolute htw-top-0 htw-right-0 htw-text-xs htw-text-white/40\">typescript</div><pre class=\"shiki\" style=\"background-color: #0d1117\"><code><span class=\"line\"><span style=\"color: #8B949E\">// src/main.ts</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { VuicPlugin } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">&quot;@vuico/vuic&quot;</span><span style=\"color: #C9D1D9\">;</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">app.</span><span style=\"color: #D2A8FF\">use</span><span style=\"color: #C9D1D9\">(VuicPlugin);</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">app.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">&quot;#app&quot;</span><span style=\"color: #C9D1D9\">);</span></span>\n<span class=\"line\"></span></code></pre></div></code></pre>\n";
